import { NavLink, Outlet } from "react-router-dom"

export const Layout = () => {
    return (
      <div>
        <nav>
          <NavLink to="/" activeClassName="active-link">
            Home
          </NavLink>
          <NavLink to="/movies">Movies</NavLink>
        </nav>
        <Outlet />
      </div>
    );
}

export default Layout
